import React from 'react';
import { Link } from 'react-router-dom';
import './RestaurantOwnerDashboard.css';

const RestaurantOwnerDashboard = () => {
  return (
    <div className="restaurant-owner-dashboard">
      <h2>Welcome to Your Restaurant Dashboard</h2>
      <p>This is the Restaurant Owner Dashboard where you can manage your menu, view orders, and update your restaurant's details.</p>
      <nav>
        <ul>
          <li><Link to="/manage-menu">Manage Menu</Link></li>
          <li><Link to="/view-orders">View Orders</Link></li>
          <li><Link to="/update-restaurant">Update Restaurant Details</Link></li>
        </ul>
      </nav>
    </div>
  );
};

export default RestaurantOwnerDashboard;
